meta.script:
document.addEventListener('DOMContentLoaded', function () {
  function addOverlayClass() {
    function checkAndUpdateBodyClass() {
      // Select all direct child divs of elements with the class .e-n-menu-content
      var menuContents = document.querySelectorAll('.e-n-menu-content > div');

      var body = document.body;
      var activeMenuFound = false;

      // Check each menuContent for the 'e-active' class
      menuContents.forEach(function(menuContent) {
        if (menuContent.classList.contains('e-active')) {
          activeMenuFound = true;
        }
      });

      // Add or remove the class based on if any active menus were found
      if (activeMenuFound) {
        body.classList.add('pf-menu-active');
      } else {
        body.classList.remove('pf-menu-active');
      }
    }

    // Use querySelectorAll to select all direct child divs again for observing their class attribute changes
    var menuContents = document.querySelectorAll('.e-n-menu-content > div');

    if (menuContents.length > 0) {
      // Create a new MutationObserver instance for observing changes
      var observer = new MutationObserver(checkAndUpdateBodyClass);

      // Observe each selected menuContent
      menuContents.forEach(function(menuContent) {
        observer.observe(menuContent, { attributes: true, attributeFilter: ['class'] });
      });
    }
  }
  addOverlayClass();
});

div.script:
document.addEventListener('DOMContentLoaded', function() {
    const headings = document.querySelectorAll('.menu-container h4');
    let currentlyActiveItem = null; // Variable to track the currently active hidden item

    headings.forEach(function(heading) {
        heading.addEventListener('mouseenter', function() {
            const menuID = this.closest('[id]').id;
            const correspondingHiddenItemID = menuID + '-items';
            const hiddenItem = document.getElementById(correspondingHiddenItemID);

            if (hiddenItem) {
                // Remove "active" class from the previously active hidden item
                if (currentlyActiveItem && currentlyActiveItem !== hiddenItem) {
                    heading.classList.remove('active');
                    currentlyActiveItem.classList.remove('active'); // Remove active class from previous
                }

                // Add "active" class to the currently hovered hidden item
                hiddenItem.classList.add('active'); // Add active class
                heading.classList.add('active');
                currentlyActiveItem = hiddenItem; // Update the currently active item
            }
        });
    });
});

body.script:
const lazyloadRunObserver = () => {
	const lazyloadBackgrounds = document.querySelectorAll( `.e-con.e-parent:not(.e-lazyloaded)` );
	const lazyloadBackgroundObserver = new IntersectionObserver( ( entries ) => {
		entries.forEach( ( entry ) => {
			if ( entry.isIntersecting ) {
				let lazyloadBackground = entry.target;
				if( lazyloadBackground ) {
					lazyloadBackground.classList.add( 'e-lazyloaded' );
				}
				lazyloadBackgroundObserver.unobserve( entry.target );
			}
		});
	}, { rootMargin: '200px 0px 200px 0px' } );
	lazyloadBackgrounds.forEach( ( lazyloadBackground ) => {
		lazyloadBackgroundObserver.observe( lazyloadBackground );
	} );
};
const events = [
	'DOMContentLoaded',
	'elementor/lazyload/observe',
];
events.forEach( ( event ) => {
	document.addEventListener( event, lazyloadRunObserver );
} );

